import React, { Component } from "react";
import Layout from "../components/Layout";
import Link from "next/link";

class Detail extends Component{
    render(){
        return(
            <Layout>
                <div className="container">
                    <div className="row">                    
                        <div className="col-4 shadow-sm p-4 mb-5 bg-dark rounded">
                        <Link href={'/blog/detail'}><a>                    
                            <img src="/static/images/products/1.png" className="img-fluid" />
                            <hr/>                          
                        </a></Link>
                        <h4 className="text-center">The Resume Game</h4>
                        </div>                    
                    </div>
                </div>               
            </Layout>               
        )
    }
}

export default Detail;
